// Estructura de DB para Usuario
const ordersModel = [
    {
    status:undefined,
    order:undefined,
    date:undefined,
    reference:undefined,
    code:undefined,
    skuName:undefined,
    lot:undefined,
    value:undefined,
    discount:undefined,
    points:undefined,
    price:undefined,
    shipping:undefined,
    totalPay:undefined,
    discountName:undefined,
    customer:undefined,
    dni:undefined,
    phone:undefined,
    state:undefined,
    city:undefined,
    divipola:undefined,
    neighborhood:undefined,
    address:undefined,
    addAddress:undefined,
    deliveryOnName:undefined,
    slaType:undefined,
    estimatedShippingDate:undefined,
    ansDelivery:undefined,
    oderDate:undefined,
    stock:undefined,
    guide:undefined,
    dispatch:undefined,
    carrier:undefined,
    trakingUrl:undefined,
    invoice:undefined,
    invoiceUrl:undefined,
    observations:undefined,
    unit:undefined,
    employee:undefined
}]

const orders = {listOrders:[], listFilters:[], pagination:[], listOrdersEdit:[],listOrdersEditStatus:[],listOrdersEditSuppliers:[]}

//se pasa un estado por defecto para definicion de estructura
function Orders(state = orders, action){
    //console.log(action.data);
    var NewState = Object.assign({},state);
    if(action.type == "loadOrders"){
        NewState.pagination = action.data.info;
        NewState.listOrders = action.data.data;
    }
    if(action.type == "loadFilters"){
        //action.data.data.unshift({_id:0,code:0,name:"Todas los Proveedores"});
        //console.log(action.data.status);
        NewState.listFilters = action.data;
    }
    if(action.type == "loadOrdersEdit"){
        NewState.listOrdersEditStatus = action.data.status;
        NewState.listOrdersEditSuppliers = action.data.suppliers;
        NewState.listOrdersEdit = action.data.data;
    }
    return NewState;
}

const DaoOrders = {Orders}

export default DaoOrders;
